import React, {Component} from 'react';
// import "../style/css-final.css";
import "../style/bootstrap.min.css";
import { Link } from "react-router-dom";
// import Search from './search';
import { actions, store } from "../store";
import { withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import ModalSignIn from '../component/modalSignIn'
import ModalSignUp from '../component/modalSignUp'
import "../style/navbar.css"

class Search extends Component{
    postSignout = () => {
        store.setState({"agungIsLogin": false, "pipitIsLogin": false, "hedyIsLogin": false, "daffaIsLogin": false});
        alert("logout succses!!!")
        // localStorage.clear()
        this.props.history.push("/");
    };
    render(){
        return(
                <nav>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"/>
                <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>

                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                <ul class="navbar-nav mr-auto">
                    <li class="nav-item">
                        <p className="nav-link">300 Produk</p>
                    </li>
                    <li class="nav-item">
                        <form class="form-inline md-form form-sm active-cyan-2 mt-2 nav-link">
                            <input class="form-control form-control-sm mr-3 w-75" type="text" placeholder="Search"
                                aria-label="Search"/>
                            <i class="fa fa-search" aria-hidden="true"></i>
                        </form>
                    </li>
                    <li class="nav-item">
                        <Link to="/Store" class="nav-link">Pedas</Link>
                    </li>
                    <li class="nav-item">
                        <Link to="/Store" class="nav-link">Manis</Link>
                    </li>
                    <li class="nav-item">
                        <Link to="/Store" class="nav-link">Masam</Link>
                    </li>
                    <li class="nav-item">
                        <Link to="/Store" class="nav-link">Asin</Link>
                    </li>
                    <li class="nav-item">
                        <Link to="/Store" class="nav-link">Halal</Link>
                    </li>
                    <div className="container-fluid">
                    <div className="row okay">
                        <div className="col-md-3 count-product">
                            <p>300 Produk</p>
                        </div>
                        <div className="col-md-5"></div>
                        <div className="col-md-4 feature-search">

                        </div>
                    </div>
                </div>
                </ul>
                </div>
            </nav> 
            </nav>
        );
    }
}

export default connect("agungIsLogin, daffaIsLogin, pipitIsLogin, hedyIsLogin, userNameInput", actions)(withRouter(Search));
